import React from 'react';
import './componentes.scss';
import tileData from './tileData';

const Productos = () =>{
const Productos = tileData.map((pro, i) => <tr key={i}> <td>{pro.title}</td> <td>{pro.author}</td> </tr>)
return(
        <table>
        <thead>
         <th>Producto</th>
         <th>Precio</th>
        </thead>
        <tbody>
        {Productos}
        </tbody>
        </table>
)
}

export default Productos
